import {
  GET_PRODUCT_TO_CART_REQUEST,
  GET_PRODUCT_TO_CART_FAILED,
  GET_PRODUCT_TO_CART_SUCCESS
} from "./contants";
const initialState = {
  cart: [],
  isLoading: true,
  error: []
}
const CartReducer = (state = initialState, action) => {
  switch (action.type) {
    case GET_PRODUCT_TO_CART_REQUEST:
      return state;
    case GET_PRODUCT_TO_CART_SUCCESS:
      return state;
    case GET_PRODUCT_TO_CART_FAILED:
      return state;
    default:
      return state
  }
}
export default CartReducer;
